import { useState } from "react";

const TextView = ({ text }) => {
  return <div>{text}</div>;
};

const CountView = ({ count }) => {
  return <div>{count}</div>;
};

const OptimizeTest = () => {
  const [count, setcount] = useState(0);
  const [text, settext] = useState("");
  return (
    <div style={{ padding: 50 }}>
      <div>
        <h2>count</h2>
        <button
          onClick={() => {
            setcount(count + 1);
          }}
        >
          +
        </button>
        <div>
          <h2>text</h2>
          <input
            onChange={(e) => {
              settext(e.target.value);
            }}
          />
        </div>
      </div>
    </div>
  );
};

export default OptimizeTest;
